import React, { useState } from "react";

const ChangeUserData = ({ userData }) => {
  const [userFormData, setUserFormData] = useState({
    name: "",
    email: "",
    password: "",
    phone: "",
  });

  const onChange = (e) => {
    setUserFormData({ ...userData, [e.target.name]: e.target.value });
  };

  const onSubmit = (e) => {
    e.preventDefault();
    console.log(userFormData);
  };

  return (
    <div>
      <h3>Изменить Данные</h3>
      <form>
        <div className="row">
          <form className="col s12" onSubmit={(e) => onSubmit(e)}>
            <div className="row">
              <div className="input-field col s12">
                <input
                  onChange={(e) => onChange(e)}
                  id="name"
                  type="text"
                  name="name"
                  className="validate"
                  value={userFormData.name}
                />
                <label htmlFor="name">Имя</label>
              </div>
            </div>
            <div className="row">
              <div className="input-field col s12">
                <input
                  onChange={(e) => onChange(e)}
                  id="email"
                  type="email"
                  name="email"
                  className="validate"
                  value={userFormData.email}
                />
                <label htmlFor="email">Электрон почта</label>
              </div>
            </div>
            <div className="row">
              <div className="input-field col s12">
                <input
                  onChange={(e) => onChange(e)}
                  name="phone"
                  id="tel"
                  type="tel"
                  className="validate"
                  value={userFormData}
                />
                <label htmlFor="tel">Телефон номер</label>
              </div>
            </div>
            <div className="row">
              <div className="input-field col s12">
                <input
                  onChange={(e) => onChange(e)}
                  name="password"
                  id="password"
                  type="text"
                  className="validate"
                  value={userFormData}
                />
                <label htmlFor="password">Пароль</label>
              </div>
            </div>

            <div className="row">
              <div className="input-field col s12">
                <button
                  type="submit"
                  className="waves-effect waves-light btn-large"
                >
                  Сохранить
                </button>
              </div>
            </div>
          </form>
        </div>
      </form>
    </div>
  );
};

export default ChangeUserData;
